import React, { useState } from "react";
import QuestionType from "./QuestionType";
import Question from "./Question";
import Options from "./Options";
import QuestionTiles from "./QuestionTiles";
import CandidateDetail from "./CandidateDetail";
import QuestionNav from "./QuestionNav";

const AttendExam = () => {
  const [questions, setQuestions] = useState([
    {
      sequenceNum: 1,
      questiomId: 101,
      questionDetails:  "Number of primitive data types in Java are?",
      optionA: "6",
      optionB: "7",
      optionC: "8",
      optionD: "9",
      optionE: "none",
      QuestionType: "Single Choice",
    },
    {
      sequenceNum: 2,
      questiomId: 102,
      questionDetails: "what is java2?",
      optionA: "A",
      optionB: "B",
      optionC: "C",
      optionD: "D",
      optionE: "none",
      QuestionType: "Single Choice",
    },
    {
      sequenceNum: 3,
      questiomId: 103,
      questionDetails: "what is java3?",
      optionA: "A",
      optionB: "B",
      optionC: "C",
      optionD: "D",
      optionE: "none",
      QuestionType: "True Or False",
    },
    {
      sequenceNum: 4,
      questiomId: 104,
      questionDetails: "what is java4?",
      optionA: "A",
      optionB: "B",
      optionC: "C",
      optionD: "D",
      optionE: "none",
      QuestionType: "True Or False",
    },
    {
      sequenceNum: 5,
      questiomId: 105,
      questionDetails: "what is java5?",
      optionA: "A",
      optionB: "B",
      optionC: "C",
      optionD: "D",
      optionE: "none",
      QuestionType: "True Or False",
    },
    {
      sequenceNum: 6,
      questiomId: 106,
      questionDetails: "what is java6?",
      optionA: "A",
      optionB: "B",
      optionC: "C",
      optionD: "D",
      optionE: "none",
      QuestionType: "True Or False",
    },
    {
      sequenceNum: 7,
      questiomId: 107,
      questionDetails: "what is java7?",
      optionA: "A",
      optionB: "B",
      optionC: "C",
      optionD: "D",
      optionE: "none",
      QuestionType: "True Or False",
    },
    {
      sequenceNum: 8,
      questiomId: 108,
      questionDetails: "what is java8?",
      optionA: "A",
      optionB: "B",
      optionC: "C",
      optionD: "D",
      optionE: "none",
      QuestionType: "True Or False",
    },
    {
      sequenceNum: 9,
      questiomId: 109,
      questionDetails: "what is java9?",
      optionA: "A",
      optionB: "B",
      optionC: "C",
      optionD: "D",
      optionE: "none",
      QuestionType: "True Or False",
    },
    {
      sequenceNum: 10,
      questiomId: 110,
      questionDetails: "what is java10?",
      optionA: "A",
      optionB: "B",
      optionC: "C",
      optionD: "D",
      optionE: "none",
      QuestionType: "True Or False",
    },
  ]);
  //   const questions = [{ q: "What is JAVA ?" }, { q: "Why do we need JAVA" }];
  const [activeQuestion, setActiveQuestion] = useState({});
  const [activeQuestionType, setActiveQuestionType] = useState(
    `${questions[0].qt}`
  );
  const [activeQuestionId, setActiveQuestionId] = useState(1);

  function onChange(sequenceNum) {
    // setActiveQuestionId(id + 1);
    // setActiveQuestion(questions[id].q);
    // setActiveQuestionType(questions[id].qt);

    questions.map(
      (question) =>{ question.sequenceNum === sequenceNum && setActiveQuestion(question); }
    );
    
   
  }

  // useEffect(()=>{
  //     const fetchTopic = fetch(`https://localhost:8443/onlineexam/control/`)
  // },[])

  return (
    <div class="container-fluid  exam-body py-3 ">
      <div class="row">
        <div class="col-9  ">
          <ul class="nav nav-pills border border-secondary-subtle p-2 rounded">
            <li class="nav-item">
              <button class="nav-link active">Core Java</button>
            </li>
            <li class="nav-item">
              <button class="nav-link">Advanced Java</button>
            </li>
          </ul>
        </div>
        <div class="col-3 text-center">
          <div>
            <img src="user.jpg" class="img-rounded float-start" alt="..."></img>
            <h6>Candidate ID : 1092</h6>
            <h5>Time Left: 10:00</h5>
          </div>
        </div>
      </div>
        
      <div class="row mt-3 ">
       
        <Question question={activeQuestion}/>
        
        <div class="col-3">
          <hr />
          <h4>You are viewing Topic A </h4>
          <br />
          <h6>Questions Palette: </h6>
          <div
            class="btn-toolbar mx-4"
            role="toolbar"
            aria-label="Toolbar with button groups"
          >
            {questions ? (
              questions.map((question, index) => (
                <div class="btn-group m-2" role="group" key={index}>
                  <button
                    type="button"
                    class="btn btn-outline-secondary px-3"
                    onClick={() => onChange(question.sequenceNum)}
                  >
                    {question.sequenceNum}
                  </button>
                </div>
              ))
            ) : (
              <></>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default AttendExam;
